import Header from "../components/Header";

function AdminDashboard() {
  return (
    <>
      <Header />
      <div style={{ padding: "40px", textAlign: "center" }}>
        <h1>Admin Dashboard</h1>
        <p>Only admins can access this page.</p>
      </div>
    </>
  );
}

export default AdminDashboard;
